import logo from './logo.svg';
import './App.css';

function App() {
  const books= [
    {title: "The Cruel Prince", author: "Holly Black"},
    {title: "A Thousand Splendid Suns", author: "Khaled Houssini"},
    {title: "Percy Jackson", author: "Rick Riordan"},
    {title: "Pride and Prejudice", author: "Jane Austen" },
    { title: "The Great Gatsby", author: "F. Scott Fitzgerald" }
  ]
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <section className ="book-recommendations">
        <h2>My Favorite Book Recommendations</h2>
          <ul>
            {books.map((book,index)=>
            <li key={index}>
              <strong>{book.title}</strong> by {book.author}
            </li> 
            )}
          </ul>
      </section>
    </div>
  );
}

export default App;
